import './InputField.css';

function InputField(props){
    const{inputType,styleClass,onClickMethod,labelText} = props;
    return(
        <>
        <label>{labelText}</label>
        <input 
        type={inputType} 
        className={styleClass}
        onClick={onClickMethod}>    
        </input>
        </>
    );
}

export default InputField;
